import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";

pdfMake.vfs = pdfFonts.pdfMake ? pdfFonts.pdfMake.vfs : pdfFonts.vfs;

export const generateReceiptPDF = (receipt, base64Logo) => {
  const docDefinition = {
    content: [
      {
        image: 'logo',
        width: 80,
        alignment: 'center',
        margin: [0, 0, 0, 10],
      },
      { text: 'FINANCE HIVE', style: 'header' },
      { text: 'Payment Receipt', style: 'subheader' },
      { text: `Payment to Invoice No: ${receipt.receiptNumber}`, style: 'invoiceText' },
      { text: '\n' },

      // Payment Details Section
      {
        table: {
          widths: ['50%', '50%'],
          body: [
            [{ text: 'Payment Date', style: 'tableHeader' }, { text: new Date(receipt.paymentDate).toLocaleDateString(), style: 'tableText' }],
            [{ text: 'Amount Paid', style: 'tableHeader' }, { text: receipt.amount.toLocaleString('en-IN', { style: 'currency', currency: 'INR' }), style: 'tableText' }],
            [{ text: 'Payer Name', style: 'tableHeader' }, { text: receipt.user.name, style: 'tableText' }],
            [{ text: 'Mobile Number', style: 'tableHeader' }, { text: receipt.user.mobileNumber, style: 'tableText'}],
            [{ text: 'EMI Number', style: 'tableHeader' }, { text: `#${receipt.serialNo}`, style: 'tableText' }],
            [{ text: 'Payment Method', style: 'tableHeader' }, { text: receipt.paymentMethod, style: 'tableText' }],
          ]
        },
        layout: 'lightHorizontalLines'
      },

      { text: '\n' },

      // Invoice Paid Box
      {
        text: 'Repayment Amount Received',
        style: 'paidText',
        color: 'green',
        bold: true,
        alignment: 'center',
        margin: [0, 10, 0, 10]
      },

      { text: '\n' },

      // Footer with contact info
      // { text: 'You can still view the original invoice by clicking on the button below.', alignment: 'center', fontSize: 10, margin: [0, 5, 0, 10] },
      // {
      //   table: {
      //     widths: ['100%'],
      //     body: [
      //       [{
      //         text: 'View Invoice',
      //         alignment: 'center',
      //         color: 'blue',
      //         link: `https://financehive.com/invoice/${receipt.receiptNumber}`,
      //         margin: [0, 5, 0, 5]
      //       }]
      //     ]
      //   },
      //   layout: 'noBorders'
      // },

      { text: '\n' },

      // // Company Footer
      // {
      //   text: 'Finance Hive, 6 High Street, Mumbai, India | Email: contact@financehive.com | Phone: +91 98765 43210',
      //   style: 'footer',
      //   alignment: 'center',
      //   margin: [0, 10, 0, 0]
      // }
    ],

    styles: {
      header: {
        fontSize: 22,
        bold: true,
        alignment: 'center',
        margin: [0, 0, 0, 5]
      },
      subheader: {
        fontSize: 16,
        bold: true,
        alignment: 'center',
        margin: [0, 0, 0, 10]
      },
      invoiceText: {
        fontSize: 12,
        italics: true,
        alignment: 'center',
        margin: [0, 0, 0, 10]
      },
      tableHeader: {
        bold: true,
        fillColor: '#f5f5f5',
        margin: [5, 5, 5, 5]
      },
      tableText: {
        margin: [5, 5, 5, 5]
      },
      paidText: {
        fontSize: 14,
        color: 'green',
        bold: true,
        alignment: 'center'
      },
      footer: {
        fontSize: 9,
        color: '#555',
        alignment: 'center'
      }
    },

    defaultStyle: {
      font: 'Roboto'
    },
    images: {
      logo: 'data:image/png;base64,' // Replace with actual base64 logo
    }
    
  };

  const pdfDoc = pdfMake.createPdf(docDefinition);
  pdfDoc.download(`Receipt_${receipt.receiptNumber}.pdf`);
};







